import PremiumSingleCard from "./PremiumSingleCard";


const PremiumCards = () => {
    return(
        <>
        <div className="premium-cards-block">
            <PremiumSingleCard time="1 Месяц" colorTime="#000"  btnColor="linear-gradient(to right, #fff, #fff, #fff, #fff)" btnBorder="2px solid #EC9A29"/>
            <PremiumSingleCard time="3 Месяца" colorTime="#66D9A2" priceMonth="169 руб/мес"/>
            <PremiumSingleCard time="6 Месяцев" colorTime="#66D9A2" priceMonth="149 руб/мес"/>
            <PremiumSingleCard time="1 Год" colorTime="#66D9A2" priceMonth="129 руб/мес"/>
        </div>
        </>
        // style={{backgroundImage: "linear-gradient(to right, #fff, #fff, #fff, #fff)", border: "2px solid #EC9A29"}}
    )
}

export default PremiumCards;
